import React from "react";

class Valikot extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      maakunnat: this.props.maakunnat,
    };
  }

  render() {}
}

componentDidMount: {
  //this.setState({ maakunnat: props.maakunnat });
  console.log("Valikoissa!");
}

export default Valikot;
